import axios from "axios";
import React, { useState } from "react";

const Register = () => {
  const [input, setInput] = useState({});
  const inputHandler = (e) => {
    const { name, value } = e.target;
    setInput({ ...input, [name]: value });
  };
//   console.log(input);

  const registerHandler = () => {
    axios.post(`http://localhost:333/api/register`,input)
    .then((data)=>{
        console.log(data);
    })
    .catc
  };
  return (
    <div>
      <form action="">
        name: <input type="text" name="name" onChange={inputHandler} />
        <br />
        phone: <input type="number" name="phone" onChange={inputHandler} />
        <br />
        email: <input type="text" name="email" onChange={inputHandler} />
        <br />
        password: <input type="text" name="password" onChange={inputHandler} />
        <br />
        <button onClick={registerHandler}>Register </button>
      </form>
    </div>
  );
};

export default Register;
